sys_script_include.script:
var Add_User = Class.create();
Add_User.prototype = Object.extendsObject(global.AbstractAjaxProcessor, {
User:function(){
	var id=this.getParameter('id');
	var title=this.getParameter('title');
	gs.info(id);
	var gr=new GlideRecord('sys_user');
	gr.initialize();
	gr.user_name=id;
	gr.title=title;
	gr.insert();
},
    type: 'Add_User'
});
